    playbackData.comments = {"ev-6320":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-6320","timestamp":1665958639808,"createdByDevGroupId":"devGroupId-0","eventSequenceNumber":6320,"permanentRelevance":"never relevant","type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-6319","lineNumber":220,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-1","timestamp":1665958639857,"commentText":"<div>In this program I am going to discuss the benefits of using multiple processes in an Elixir program, the main one being that the work can be spread across multiple processors.&nbsp;</div><div><br></div><div>I will use some code from a previous program that calculates poker probabilities. The code is shown in the file poker.ex right now. Please take a look at it or review the playback called, \"<a href=\"https://markm208.github.io/exbook/chapter1/11/index.html\">Poker Probabilities</a>\".<br></div><div><br></div><div>If you recall, this code uses brute force to estimate poker probabilities by creating many, many random groups of cards and then counting how many times each hand shows up.&nbsp;</div><div><br></div><div>I will run three different versions of this program using:</div><div>- one process to play 1,000,000 hands<br></div><div>- 1,000,000 processes to play 1,000,000 hands</div><div>- 10 processes to play 1,000,000 hands</div><div><br></div><div>I will measure the time it takes to run these different versions of the program and try to explain the differences in their run times.<br></div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ev-6718":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-6718","timestamp":1665958734085,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":6718,"type":"INSERT","fileId":"fileId-1","character":" ","previousNeighborId":"ev-6717","lineNumber":3,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1665961617974,"commentText":"<div>I start by writing a new function called <span style=\"font-family: Courier;\">timed_run</span>. This function will use the <span style=\"font-family: Courier;\">Poker</span> module to play 1,000,000 hands of poker.&nbsp;</div><div><br></div><div>On line 11 I call the <span style=\"font-family: Courier;\">play_poker</span> function which will return a map with the number of times each hand shows up.</div><div><br></div><div>I am interested in finding out how long this takes to run on my machine. Elixir has a way to measure how long a function takes to execute. I'll use it next.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"def timed_run() do\n    num_hands_to_play = 1000000\n    Poker.play_poker(num_hands_to_play, 7)\n  end","startRow":8,"startColumn":2,"endRow":11,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.ex","viewableBlogText":"  def timed_run() do\n    num_hands_to_play = 1000000\n    Poker.play_poker(num_hands_to_play, 7)\n  end","commentTags":[],"questionCommentData":null},{"id":"commentId-6","displayCommentEvent":{"id":"ev-6718","timestamp":1665958734085,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":6718,"type":"INSERT","fileId":"fileId-1","character":" ","previousNeighborId":"ev-6717","lineNumber":3,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1665961953155,"commentText":"<div>Elixir inherits a function from Erlang to time a function, it is called <span style=\"font-family: Courier;\"><a href=\"https://www.erlang.org/doc/man/timer.html#tc-3\">:timer.tc</a></span>. This function takes a module, a function name (as an atom), and parameter list.&nbsp;</div><div><br></div><div>A timer will be started, the function will be executed, and then the timer will be stopped. It returns the duration in microseconds (a microsecond is one-millionth of a second) and the return value from the function in a tuple:<br><span style=\"font-family: Courier;\">{duration, return_value}</span><br></div><div><br></div><div>On line 3 I capture those two values in <span style=\"font-family: Courier;\">duration_in_microseconds</span> and <span style=\"font-family: Courier;\">results</span>. </div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"{duration_in_microseconds, results} = :timer.tc(Main, :timed_run, [])","startRow":2,"startColumn":4,"endRow":2,"endColumn":73}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":4,"currentFilePath":"/main.ex","viewableBlogText":"  def run() do\n    {duration_in_microseconds, results} = :timer.tc(Main, :timed_run, [])\n    IO.puts(\"Elapsed time: #{duration_in_microseconds} microseconds (#{duration_in_microseconds/1000000} seconds)\")\n    Poker.results_to_string(results)\n    :ok\n  end","commentTags":[],"questionCommentData":null},{"id":"commentId-1","displayCommentEvent":{"id":"ev-6718","timestamp":1665958734085,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":6718,"type":"INSERT","fileId":"fileId-1","character":" ","previousNeighborId":"ev-6717","lineNumber":3,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1665958863764,"commentText":"<div>On lines 4-5 I print out the recorded duration of <span style=\"font-family: Courier;\">timed_run</span> and the results of playing one million hands.</div><div><br></div><div>You can see in the attached screenshot that on my machine it takes just over 4 seconds to complete <span style=\"font-family: Courier;\">Poker.play_poker</span>.</div><div><br></div><div>This duration does not include any time displaying the results. The function is processor intensive and does not do any I/O.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"IO.puts(\"Elapsed time: #{duration_in_microseconds} microseconds (#{duration_in_microseconds/1000000} seconds)\")\n    Poker.results_to_string(results)","startRow":3,"startColumn":4,"endRow":4,"endColumn":36}],"imageURLs":["media/images/1665958850627-01.png"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":2,"currentFilePath":"/main.ex","viewableBlogText":"  def run() do\n    {duration_in_microseconds, results} = :timer.tc(Main, :timed_run, [])\n    IO.puts(\"Elapsed time: #{duration_in_microseconds} microseconds (#{duration_in_microseconds/1000000} seconds)\")\n    Poker.results_to_string(results)\n    :ok\n  end","commentTags":["image","successful-run"],"questionCommentData":null},{"id":"commentId-7","displayCommentEvent":{"id":"ev-6718","timestamp":1665958734085,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":6718,"type":"INSERT","fileId":"fileId-1","character":" ","previousNeighborId":"ev-6717","lineNumber":3,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1665962628600,"commentText":"<div>Because I am not spawning any processes yet there is only one process for the interactive shell, <span style=\"font-family: Courier;\">iex</span>, that I am using to call <span style=\"font-family: Courier;\">Main.run</span>.</div><div><br></div><div>The machine that I am using to run this code on is a modern computer with multiple cores. I think I can get better performance if I use them.<br></div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":["media/images/1665962436872-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.ex","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"ev-7234":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-7234","timestamp":1665958959884,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":7234,"type":"INSERT","fileId":"fileId-1","character":"d","previousNeighborId":"ev-7233","lineNumber":24,"column":5,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1665963565168,"commentText":"In this new version of the <span style=\"font-family: Courier;\">timed_run</span> function I spawn one new process for each of the million hands that I want to evaluate. Then I call <span style=\"font-family: Courier;\">await_results</span> so that the main process can collect all of the results.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"num_hands_to_play = 1000000\n    Enum.each(1..num_hands_to_play, fn(_num) -> spawn_link(Poker, :start, [self()]) end)\n    await_results(num_hands_to_play, [])","startRow":9,"startColumn":4,"endRow":11,"endColumn":40}],"imageURLs":["media/images/1665963432396-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":1,"currentFilePath":"/main.ex","viewableBlogText":"  def timed_run() do\n    num_hands_to_play = 1000000\n    Enum.each(1..num_hands_to_play, fn(_num) -> spawn_link(Poker, :start, [self()]) end)\n    await_results(num_hands_to_play, [])\n  end","commentTags":["image"],"questionCommentData":null},{"id":"commentId-10","displayCommentEvent":{"id":"ev-7234","timestamp":1665958959884,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":7234,"type":"INSERT","fileId":"fileId-1","character":"d","previousNeighborId":"ev-7233","lineNumber":24,"column":5,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1665963831872,"commentText":"The version of <span style=\"font-family: Courier;\">await_results</span> that starts on line 19 waits for all of the new processes to send their one result back to the original main process.<br><br><div>Each best hand atom is added to a list on line 23 and a tail recursive call keeps the main process listening for results.&nbsp;</div><div><br></div><div>The number of processes is known so I just decrease the <span style=\"font-family: Courier;\">num_results</span> by one each time this version of the function is executed.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"def await_results(num_results, results) do\n    hand = receive do\n      {:results, hand} -> hand\n    end\n    await_results(num_results - 1, [hand | results])\n  end","startRow":18,"startColumn":2,"endRow":23,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":0,"currentFilePath":"/main.ex","viewableBlogText":"  def await_results(0, results) do\n    Enum.frequencies(results)\n  end\n\n  def await_results(num_results, results) do\n    hand = receive do\n      {:results, hand} -> hand\n    end\n    await_results(num_results - 1, [hand | results])\n  end","commentTags":[],"questionCommentData":null},{"id":"commentId-2","displayCommentEvent":{"id":"ev-7234","timestamp":1665958959884,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":7234,"type":"INSERT","fileId":"fileId-1","character":"d","previousNeighborId":"ev-7233","lineNumber":24,"column":5,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1665959138867,"commentText":"<div>The version of <span style=\"font-family: Courier;\">await_results</span> that starts on line 15 gets called when all of the child processes have returned their results by matching <span style=\"font-family: Courier;\">num_results</span> to 0. <span style=\"font-family: Courier;\">results</span> is a list that holds all of the best hand atoms in no particular order.<br></div><div><br></div><div>When this happens I call <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Enum.html#frequencies/1\">Enum.frequencies</a></span> to create a map with each hand and a count of how many times they showed up in the list, <span style=\"font-family: Courier;\">results</span>. I display this map on line 5 (see the attached screenshot).<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"def await_results(0, results) do\n    Enum.frequencies(results)\n  end","startRow":14,"startColumn":2,"endRow":16,"endColumn":5}],"imageURLs":["media/images/1665974216185-image.png","media/images/1665959134715-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":7,"currentFilePath":"/main.ex","viewableBlogText":"  def await_results(0, results) do\n    Enum.frequencies(results)\n  end\n\n  def await_results(num_results, results) do\n    hand = receive do\n      {:results, hand} -> hand\n    end\n    await_results(num_results - 1, [hand | results])\n  end","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-7318":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-7318","timestamp":1665959060105,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":7318,"type":"DELETE","fileId":"fileId-1","character":" ","previousNeighborId":"ev-7314","lineNumber":4,"column":1},"developerGroupId":"devGroupId-2","timestamp":1665959156600,"commentText":"<div>When an Elixir program has multiple processes the Erlang VM will schedule them to run on different available processors. I am running these examples on a fairly modern, high powered computer with multiple cores.</div><div><br></div><div>The function <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/System.html#schedulers_online/0\">System.schedulers_online</a></span> returns the number of available processors the Erlang VM has available to run Elixir code. I print this out on line 3. In the attached screenshot you can see that there are 10 cores available on my machine.</div><div><br></div><div>This version did run faster than the last version (about 18% faster) but with 10 processors available you might wonder why it wasn't 10 times faster?</div><div><br></div><div>There are a few reasons. First, there is some overhead associated with creating and scheduling 1,000,000 processes. Further, each of the processes has to wait for one of the 10 processors to be available before it can evaluate a hand. Each of the million processes sends some data back to the main process at roughly the same time so the main process becomes a bottleneck just collecting those results. Together these contribute to a slightly less than expected performance improvement.&nbsp;</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"IO.puts(\"There are #{System.schedulers_online()} active processors\")","startRow":2,"startColumn":4,"endRow":2,"endColumn":72}],"imageURLs":["media/images/1665959256988-03v3.png"],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":6,"currentFilePath":"/main.ex","viewableBlogText":"  def run() do\n    IO.puts(\"There are #{System.schedulers_online()} active processors\")\n\n    {duration_in_microseconds, results} = :timer.tc(Main, :timed_run, [])\n    IO.puts(\"Elapsed time: #{duration_in_microseconds} microseconds (#{duration_in_microseconds/1000000} seconds)\")\n    Poker.results_to_string(results)\n    :ok\n  end","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-8201":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-8201","timestamp":1665959484432,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":8201,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-8200","lineNumber":221,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1665965232086,"commentText":"<div>The next approach that I am going to try is to reduce the amount of message passing that takes place. I will have fewer processes that will play more hands and send their results back to the main process.</div><div><br></div><div>Since I know that I have 10 processors available I will spawn 10 processes to do the poker calculations. Each one will do 1/10th of the work.&nbsp;</div><div><br></div><div>On lines 13-14 I determine the number of processes and the number of hands to play on each one (since I am not hard coding these values this code should now run well any machine). <br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"num_processes = System.schedulers_online()\n    hands_per_processor = div(num_hands_to_play, num_processes)","startRow":12,"startColumn":4,"endRow":13,"endColumn":63}],"imageURLs":["media/images/1665965075014-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":3,"currentFilePath":"/main.ex","viewableBlogText":"  def timed_run() do\n    num_hands_to_play = 1000000\n    num_processes = System.schedulers_online()\n    hands_per_processor = div(num_hands_to_play, num_processes)\n    Enum.each(1..num_processes, fn(_num) -> spawn_link(Poker, :start, [hands_per_processor, self()]) end)\n    await_results(num_processes, Map.new)\n  end","commentTags":["image"],"questionCommentData":null},{"id":"commentId-12","displayCommentEvent":{"id":"ev-8201","timestamp":1665959484432,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":8201,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-8200","lineNumber":221,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1665965269535,"commentText":"Next, on lines 15-16 I create the processes and await the results.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"Enum.each(1..num_processes, fn(_num) -> spawn_link(Poker, :start, [hands_per_processor, self()]) end)\n    await_results(num_processes, Map.new)","startRow":14,"startColumn":4,"endRow":15,"endColumn":41}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":1,"currentFilePath":"/main.ex","viewableBlogText":"  def timed_run() do\n    num_hands_to_play = 1000000\n    num_processes = System.schedulers_online()\n    hands_per_processor = div(num_hands_to_play, num_processes)\n    Enum.each(1..num_processes, fn(_num) -> spawn_link(Poker, :start, [hands_per_processor, self()]) end)\n    await_results(num_processes, Map.new)\n  end","commentTags":[],"questionCommentData":null},{"id":"commentId-13","displayCommentEvent":{"id":"ev-8201","timestamp":1665959484432,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":8201,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-8200","lineNumber":221,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1665965387944,"commentText":"<div>I update the <span style=\"font-family: Courier;\">start</span> function in the <span style=\"font-family: Courier;\">Poker</span> module to play many hands per process (100,000 in this example). <span style=\"font-family: Courier;\">play_poker</span> collects all of the results into a map that is returned from it.&nbsp;</div><div><br></div><div>I send this map back to the main process. Remember, there are only 10 processes so only 10 messages are sent instead of 1,000,000.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def start(num_hands, client_pid) do\n    hand_frequencies = play_poker(num_hands, 7)\n    send(client_pid, {:results, hand_frequencies})\n  end","startRow":220,"startColumn":2,"endRow":223,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/poker.ex","viewableBlogText":"  def start(num_hands, client_pid) do\n    hand_frequencies = play_poker(num_hands, 7)\n    send(client_pid, {:results, hand_frequencies})\n  end","commentTags":[],"questionCommentData":null},{"id":"commentId-14","displayCommentEvent":{"id":"ev-8201","timestamp":1665959484432,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":8201,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-8200","lineNumber":221,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1665965943342,"commentText":"<div>The <span style=\"font-family: Courier;\">await_results</span> functions are a little different because the main process receives a summary of each of the 10 processes' results instead of a single best hand.</div><div><br></div><div>On line 25 I use the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Map.html#merge/3\">Map.merge</a></span> function to&nbsp;merge the main process's existing results with a child process's returned results.&nbsp;</div><div><br></div><div>The version of <span style=\"font-family: Courier;\">merge</span> that I am using takes a function that handles when there is a conflict in the maps that are being merged. I supply a function that adds the two conflicting values together (see the attached picture).<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"def await_results(0, results) do\n    results\n  end\n\n  def await_results(num_results, results) do\n    results = receive do\n      {:results, hand_frequencies} -> Map.merge(results, hand_frequencies, fn(_key, val1, val2) -> val1 + val2 end)\n    end\n    await_results(num_results - 1, results)\n  end","startRow":18,"startColumn":2,"endRow":27,"endColumn":5}],"imageURLs":["media/images/1665965845757-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.ex","viewableBlogText":"  def await_results(0, results) do\n    results\n  end\n\n  def await_results(num_results, results) do\n    results = receive do\n      {:results, hand_frequencies} -> Map.merge(results, hand_frequencies, fn(_key, val1, val2) -> val1 + val2 end)\n    end\n    await_results(num_results - 1, results)\n  end","commentTags":["image"],"questionCommentData":null},{"id":"commentId-4","displayCommentEvent":{"id":"ev-8201","timestamp":1665959484432,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":8201,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-8200","lineNumber":221,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1665959531875,"commentText":"<div>The attached screenshot shows that this approach is a significant improvement to the other two. It takes under a second to evaluate one million hands.&nbsp;</div><div><br></div><div>This can be attributed to spreading the work out evenly among the available processors to reduce the process&nbsp;creation and scheduling overhead and minimizing the messages that are sent back and forth.<br></div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":["media/images/1665959527980-04.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/poker.ex","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"ev-6829":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-6829","timestamp":1665958916340,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":6829,"type":"INSERT","fileId":"fileId-0","character":"d","previousNeighborId":"ev-6828","lineNumber":224,"column":5,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1665963348494,"commentText":"<div>I add a new function to the <span style=\"font-family: Courier;\">Poker</span> module that will be used to spawn new processes.</div><div><br></div><div>The <span style=\"font-family: Courier;\">start</span> function gets seven random cards and then determines what is the best hand that can be made from them by calling <span style=\"font-family: Courier;\">best_hand</span>.&nbsp;</div><div><br></div><div>The function then sends an atom back to the client. This will be something like <span style=\"font-family: Courier;\">:high_card</span> or <span style=\"font-family: Courier;\">:pair</span> or one of the other hands.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def start(client_pid) do\n    hand = best_hand(deal_cards(7))\n    send(client_pid, {:results, hand})\n  end","startRow":220,"startColumn":2,"endRow":223,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/poker.ex","viewableBlogText":"  def start(client_pid) do\n    hand = best_hand(deal_cards(7))\n    send(client_pid, {:results, hand})\n  end","commentTags":[],"questionCommentData":null}]};
